import React from 'react';
import Image from '../images/img5.jpg';
import Typical from 'react-typical';


const Home = () => {
 
  return (
    <div style={{backgroundImage: `url(${Image})`}} className="relative w-full h-screen bg-cover bg-no-repeat bg-center" >
        <div className='absolute h-full w-full mx-auto text-center text-white bg-gradient-to-b from-black'>
          <h1 className="uppercase font-bold text-6xl">Hi, I am Younes EL MOUATASIM</h1>
          <div>
            I am
            <Typical
              steps={['Developer', 1800, 'Searcher', 1800]}
              loop={Infinity}
              wrapper="p"
            />
          </div>
          <button className="btn btn-secondary">
            Plus
          </button>
         
        </div>
    </div>
  )
}

export default Home
